INSERT INTO `data_news_item` VALUES (1, '', '没有什么好知道的', '标称名称1', 'https://v6.thinkadmin.top/upload/0b/41ddc2fe3395af9c8de51282b70e87.jpg', '有啥意义呢！？', '<ul>\r\n	<li>\r\n	<p>&nbsp;</p>\r\n\r\n	<p><a>　　参考消息网9月19日报道 中国国务委员兼外交部长王毅在接受新华社记者专访时表示，中俄团结如山，友谊牢不可破，两国战略协作不会因外部环境影响而发生任何改变。</a></p>\r\n\r\n	<p><a>　　据俄新社北京9月17日报道，王毅说：&ldquo;在世界动荡变革期，牢固的中俄关系对维护地区及世界和平安全具有更加突出意义。&rdquo;</a></p>\r\n\r\n	<p><a>　　他指出：&ldquo;这次是疫情全球暴发后中俄外长首次面对面会晤。我同拉夫罗夫外长进行了长时间会谈、交流，就加强双边关系和应对国际地区挑战达成一系列重要共识。&rdquo;</a></p>\r\n\r\n	<p><a>　　王毅表示，双方发表了一份内容广泛的两国外长联合声明，阐释了双方对几乎所有国际问题的共同立场。</a></p>\r\n\r\n	<p><br />\r\n	<a>　　报道称，王毅于9月10日至16日赴俄罗斯出席上海合作组织成员国外长理事会会议并对俄罗斯、哈萨克斯坦、吉尔吉斯斯坦、蒙古国进行访问。王毅与俄罗斯外长拉夫罗夫9月11日在莫斯科举行会谈。拉夫罗夫在会谈结束后表示，莫斯科拒绝美国&ldquo;联手对抗&rdquo;中国或其他国家的政策，俄中两国将继续扩大在国际舞台上的合作。</a></p>\r\n\r\n	<p><a>　　另据香港《南华早报》网站9月17日报道，王毅强调，面对印太地区以美国为首的新兴多边安全集团构成的威胁与挑战，俄罗斯、蒙古国和中亚国家必须加强合作。</a></p>\r\n\r\n	<p><a>　　报道称，在美国国防部长马克&middot;埃斯珀突然重申，华盛顿准备在该地区成立一个类似北约的地缘战略联盟之后，官方通讯社新华社发表了王毅的上述讲话。埃斯珀称这个地区是&ldquo;与中国进行大国竞争的中心&rdquo;。</a></p>\r\n\r\n	<p><a>[&nbsp;系统代码&nbsp;]</a>&nbsp;<a href=\"http://www.thinkphp.cn/code/8895.html\" target=\"_blank\">ThinkAdmin v6.0 基于 ThinkPHP6.0 后台开发框架</a></p>\r\n\r\n	<p>2020/01/21 16:25浏览2059次&nbsp;评论：(4)&nbsp;anyon</p>\r\n	</li>\r\n	<li>\r\n	<p><a>[&nbsp;功能实现&nbsp;]</a>&nbsp;<a href=\"http://www.thinkphp.cn/code/7314.html\" target=\"_blank\">ThinkAdmin v5.0 发布，基于ThinkPHP5.1后台开发框架</a></p>\r\n\r\n	<p>2019/08/07 17:18浏览4435次&nbsp;评论：(0)&nbsp;anyon</p>\r\n	</li>\r\n	<li>\r\n	<p><a>[&nbsp;功能实现&nbsp;]</a>&nbsp;<a href=\"http://www.thinkphp.cn/code/1342.html\" target=\"_blank\">【更新】ThinkPHP3.2.3通用后台&ndash;ThinkAdmin</a></p>\r\n\r\n	<p>2019/04/12 18:29浏览25313次&nbsp;评论：(36)&nbsp;xiaoshi1991</p>\r\n	</li>\r\n</ul>', 0, 2, 0, 3, 0, 1, 1, '2020-09-14 10:11:27');
