INSERT INTO `data_news_item` VALUES (11, '', '阿里马涛：重新定义云时代的开源操作系统 | 人物志', ',56451,', 'https://v6.thinkadmin.top/upload/c8/71369633e34eed2459885f1991ce42.gif', 'adsga', '<p><img src=\"https://imgconvert.csdnimg.cn/aHR0cHM6Ly9tbWJpei5xcGljLmNuL21tYml6X3BuZy9QbjRTbTBSc0F1Z2RmQ1hEeHJRZkJMcm03dE4wMmxpYkd6TTV0bmxrOXRlNG5tRzhYdlJpY0o5M0xNWDJMNW1IZ3FqOVpoaWN3cG9pY0h6bHU4SEN1bm03d1EvNjQw?x-oss-process=image/format,png\" /></p>\r\n\r\n<p>作者 | Just</p>\r\n\r\n<p>出品 |&nbsp;CSDN（ID:CSDNnews）</p>\r\n\r\n<p>随着云计算的发展，以及Linux平台的不断发展和生态系统的不断完善，越来越多的企业、云服务提供商都将Linux作为其数据中心的首选操作系统。</p>\r\n\r\n<p>不过，作为云基础设施的底座，针对云上产品和环境进行定制、优化的需求大幅增长。基于此，阿里巴巴操作系统团队开发了 Alibaba Cloud Linux，以连接阿里云各类产品与客户应用，更好发挥云端的能力。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>在近日的&ldquo;长沙1024程序员节&rdquo;期间，CSDN 「人物志」栏目采访了阿里云研究员、基础软件部操</p>\r\n', 0, 0, 0, 0, 0, 1, 1, '2020-10-29 21:26:00');
