INSERT INTO `data_news_item` VALUES (13, '', '玩物得志完成8000万美元C轮融资，将成长为国风文化电商标杆|钛快讯', ',,', 'https://v6.thinkadmin.top/upload/3e/b0f2c8e0451ef6c7f82988785b26b4.jpg', '交易额已突破10亿元人民币，单月服务次数突破100万单，已发展成为国风文玩行业最具规模的鉴定机构，预计2020年全年，平台交易额将突破100亿元人民币。\r\n\r\n玩物得志创始人&CEO唐金曾先后在京东、阿里任职，曾在某知名文玩平台参与行业首批商家的线上化教育。在他看来，', '<p>玩物得志，本次轮融资后将成为该垂类赛道累计融资金额最多的公司。</p>\r\n\r\n<p><img alt=\"播放\" src=\"https://www.tmtpost.com/public/img/posts_v2/icon_play.png\" /></p>\r\n\r\n<h3><img alt=\"\" src=\"https://www.tmtpost.com/public/img/posts_v2/icon_music.png\" />玩物得志完成8000万美元C轮融资，将成长为国风文化电商标杆|钛快讯</h3>\r\n\r\n<p>00:0004:50</p>\r\n\r\n<article>\r\n<p><strong><img alt=\"图片来源：视觉中国\" id=\"edit_4831402\" src=\"https://images.tmtpost.com/uploads/images/2020/11/bbe8fd7bcf699fedf04db83d9be27f79_1604453768.jpeg?imageMogr2/strip/interlace/1/quality/85/thumbnail/1400x1017/gravity/center/crop/!1400x1017&amp;ext=.jpeg\" /></strong></p>\r\n\r\n<p>图片来源：视觉中国</p>\r\n\r\n<p><strong>钛媒体快讯 | 11月4日消息：</strong>国风文化电商平台杭州装点文化创意有限公司（下文简称：玩物得志）宣布完成8000万美金C轮融资，由华兴资本旗下的华兴新经济基金、源码资本联合领投，GGV纪源资本、众源资本参与跟投。据玩物得志管理层透露，本轮融资将用于平台新一轮战略升级，聚焦行业深度，进一步完善用户服务体系建设，同时强化人才招募与培养等。</p>\r\n\r\n<p>公开资料显示，玩物得志创立于2018年，创立至今，共计完成五轮融资，本次轮融资后将成为该垂类赛道累计融资金额最多的公司。</p>\r\n\r\n<blockquote>\r\n<p>2020年11月3月，获得8000万美元C轮融资，由华兴新经济基金、源码资本联合领投，GGV纪源资本、众源资本参与跟投；</p>\r\n\r\n<p>2020年4月20日，获得数千万美元 B轮， 由源码资本领投，老股东参与跟投；</p>\r\n\r\n<p>2019年4月11日，获得A轮融资，由GGV纪源资本投资；</p>\r\n\r\n<p>2019年1月20日 ，获得Pre-A轮融资， 由真格基金投资；&nbsp;</p>\r\n\r\n<p>2018年12月18日， 获得天使轮 融资，由险峰K2VC、青雨投资&nbsp;投资</p>\r\n</blockquote>\r\n\r\n<p>玩物得志最初定位是一家国风文化电商平台，主打文玩工艺品的线上交易。APP于2019年3月上线，仅一年多时间，就拥有4200多万注册用户，2020年9月 MAU（月活跃用户数）已高达514万，位居文玩电商行业第一名。</p>\r\n\r\n<p>从交易额来看，单月交易额已突破10亿元人民币，单月服务次数突破100万单，已发展成为国风文玩行业最具规模的鉴定机构，预计2020年全年，平台交易额将突破100亿元人民币。</p>\r\n\r\n<p>玩物得志创始人&amp;CEO唐金曾先后在京东、阿里任职，曾在某知名文玩平台参与行业首批商家的线上化教育。在他看来，目前国风文化品类仍处于早期阶段，玩物得志仅完成了文玩渠道的线上化，还有很多可以优化的空间。行业中很多工艺美术及文化相关品类还未到品牌化阶段，处于供给分散、质量与服务良莠不齐的状态，产业需要专业团队提供更深入的定制服务。鉴别是重塑行业的第一步，让用户有一个可以放心买文玩产品的专业渠道。我们的愿景是建立服务标准，把行业做大。既要服务行业里的精准客户群体，又要把这个标准渗透给更多年轻用户，让他们能进入这个行业。</p>\r\n\r\n<p>于是，玩物得志APP首创&ldquo;玩物鉴别&rdquo;文玩交易全流程商品鉴别服务，通过&ldquo;先鉴别，后发货&rdquo;的服务模式为买卖两端解决行业信任问题，平台将初步鉴别合格的商品统一寄送到占地逾6000平米的官方鉴别仓库，鉴别师在全程监控录像下开箱核验，由平台出具鉴别证书、统一包装并寄给买家，一旦发现商品质量问题将直接进入售后保障流程，并对商家做处罚，保障用户的购物权益。并为每笔订单提供唯一的商品溯源码，商品入库后的全流程都可以据此进行追溯，试图为文玩电商行业创立了线上鉴别服务标准。</p>\r\n\r\n<p>目前，平台已与500位拥有GAC（中国宝玉石鉴定认证）、CGC（国家注册鉴定师）、FGA（英国宝石协会）、NGTC（国家珠宝玉石质量监督检验管理中心 ）等资质的资深鉴别师合作。</p>\r\n\r\n<p><strong>值得一提的是，</strong>今年8月，玩物得志APP邀请潘粤明先生担任平台首席品鉴官，开创文玩平台的明星代言模式。9月，玩物得志APP联合30多家国风品牌在线下举办了首届杭州市历史经典文化潮玩节，传承传统经典文化品牌。</p>\r\n\r\n<p>玩物得志的C轮投资方，华兴新经济基金执行董事雷鸣向钛媒体表示，玉翠文玩本身就是万亿级的市场，随着民族自信的崛起，玉翠文玩为代表的国风文化迎来新的发展机遇。同时这个赛道之前线上化程度较低，但是我们看到了线上切线下的明确趋势，直播更是直接的催化剂。从品类属性来看，玉翠文玩这个品类需要平台提供保真鉴定服务、更好的内容生态和社区氛围，因此以玩物得志为代表的垂直电商平台和综合类电商平台相比有差异化的比较优势。我们看好以金尚为首的创始团队，深谙行业痛点，引领这个传统的行业不断创新，为消费者提供了更可信赖的生态环境，大幅提升了买卖家的交易效率。（本文首发钛媒体App，作者 | 郭虹妘）</p>\r\n</article>\r\n', 0, 0, 0, 0, 0, 0, 1, '2020-11-04 10:22:38');
