INSERT INTO `data_news_item` VALUES (19, 'A20201124504669', '深刻认识和科学把握新发展阶段111111111111111111111111111111111111111111123cdsd水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水水', ',说的是,', 'https://v6.thinkadmin.top/upload/32/68298f6610d84c51bb566646930567.jpg', '“‘十四五’时期是我国全面建成小康社会、实现第一个百年奋斗目标之后，乘势而上开启全面建设社会主义现代化国家新征程、向第二个百年奋斗目标进军的第一个五年，我国将进入新发展阶段。”这是以习近平同志为核心的党中央深刻把握国内国际发展大势作出的重大战略论断。这一论断，指明了“十四五”时期及更长时期我国发展所处的历史方位，具有十分重大的理论和实践意义，务须深刻认识、科学把握。\r\n\r\n　　新发展阶段，就是全面建设社会主义现代化国家、向第二个百年奋斗目标进军的阶段。进入新发展阶段，在我国发展进程中具有里程碑意义。这个里程碑铭记了中国人民和中国共产党为实现中华民族伟大复兴而顽强奋斗的光辉历史，标刻了我国社会主义现代化建设承前启后、继往开来的历史坐标。', '<p>&ldquo;&lsquo;十四五&rsquo;时期是我国全面建成小康社会、实现第一个百年奋斗目标之后，乘势而上开启全面建设社会主义现代化国家新征程、向第二个百年奋斗目标进军的第一个五年，我国将进入新发展阶段。&rdquo;这是以习近平同志为核心的党中央深刻把握国内国际发展大势作出的重大战略论断。这一论断，指明了&ldquo;十四五&rdquo;时期及更长时期我国发展所处的历史方位，具有十分重大的理论和实践意义，务须深刻认识、科学把握。<span><img alt=\"\" src=\"https://v6.thinkadmin.top/upload/18/4bf1a63e851c07bdc2133813cf89f8.png\" style=\"max-width:100%;border:0\" /></span></p>\r\n\r\n<p>　　新发展阶段，就是全面建设社会主义现代化国家、向第二个百年奋斗目标进军的阶段。进入新发展阶段，在我国发展进程中具有里程碑意义。这个里程碑铭记了中国人民和中国共产党为实现中华民族伟大复兴而顽强奋斗的光辉历史，标刻了我国社会主义现代化建设承前启后、继往开来的历史坐标。</p>\r\n\r\n<p><span><img alt=\"\" src=\"https://v6.thinkadmin.top/upload/18/4bf1a63e851c07bdc2133813cf89f8.png\" style=\"max-width: 100%; border: 0px; float: left;\" /></span></p>\r\n\r\n<p>　　鸦片战争之后，中国人民和无数仁人志士不屈不挠，苦苦寻求中国现代化之路。但在半殖民地半封建社会的条件下，中国现代化没有也不可能取得成功。新中国成立后，我们党孜孜以求，对社会主义现代化建设进行了艰辛探索。早在1957年，毛泽东同志就指出，&ldquo;必须实现国家的社会主义工业化&rdquo;，&ldquo;我们一定会建设一个具有现代工业、现代农业和现代科学文化的社会主义国家&rdquo;。1964年12月，周恩来同志在第三届全国人民代表大会上所作的政府工作报告中明确提出：&ldquo;从第三个五年计划开始，我国的国民经济发展，可以按两步来考虑：第一步，建立一个独立的比较完整的工业体系和国民经济体系；第二步，全面实现农业、工业、国防和科学技术的现代化，使我国经济走在世界的前列。&rdquo;在党的坚强领导下，中国人民发愤图强、艰苦奋斗，在旧中国&ldquo;一穷二白&rdquo;的基础上建立起了独立的比较完整的工业体系和国民经济体系，迈出了社会主义现代化建设的坚实步伐。改革开放后，我们党提出社会主义现代化建设的&ldquo;三步走&rdquo;战略。进入21世纪，在人民生活总体上达到小康水平之后，我们党又提出，到建党100年时全面建成惠及十几亿人口的更高水平的小康社会，然后再奋斗30年，到新中国成立100年时，基本实现现代化，把我国建成社会主义现代化国家。党的十八大以来，中国特色社会主义进入新时代，中华民族迎来了从站起来、富起来到强起来的伟大飞跃。党的十九大站在新的更高的历史起点上，对实现第二个百年奋斗目标作出分两个阶段推进的战略安排，即到2035年基本实现社会主义现代化，到本世纪中叶把我国建成富强民主文明和谐美丽的社会主义现代化强国。</p>', 0, 0, 0, 0, 0, 1, 1, '2020-11-17 11:20:05');
