INSERT INTO `wechat_news_article` VALUES (9, '图文1', 'https://v6.thinkadmin.top/upload/9e/cec8fc872a5a076e06eeda9709b2ce.jpg', 0, '管理员啊啊啊', '&nbsp;\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n&nbsp;\n\n\n\n\n\n\n\n\n\n&nbsp;\n\n风雨中一路走来\n\n中华人民共和国\n\n发生了翻天覆地的变化\n\n&nbsp;\n\n中国电信\n\n是党和国家红色通信事业的传承者', '<section><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"313\" data-backw=\"546\" data-cropselx1=\"0\" data-cropselx2=\"546\" data-cropsely1=\"0\" data-cropsely2=\"313\" data-fail=\"0\" data-ratio=\"0.5734639358860196\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1oMHkd92GdEurAjIUXxvw3PZKricq2gboPdoiaeHATTEW1WscPPMaA0eA/640?wx_fmt=png\" data-type=\"png\" data-w=\"1123\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1oMHkd92GdEurAjIUXxvw3PZKricq2gboPdoiaeHATTEW1WscPPMaA0eA/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<section><strong aria-describedby=\"语音标题\" id=\"voice_title_MjM5OTAzMjc4MF8yNjUwMTM1MzMx_0\" role=\"link\">8月29日邦妹读早报</strong>来自创业邦<em aria-hidden=\"true\" id=\"voice_playtime_MjM5OTAzMjc4MF8yNjUwMTM1MzMx_0\">00:00</em><em id=\"voice_duration_MjM5OTAzMjc4MF8yNjUwMTM1MzMx_0\">04:35</em></section>\n\n<p><a data-miniprogram-appid=\"wx6928164d5af4877e\" data-miniprogram-nickname=\"创投大全\" data-miniprogram-path=\"pages/today/today\" data-miniprogram-servicetype=\"0\" data-miniprogram-type=\"text\" href=\"https://mp.weixin.qq.com/s/awFlEzqX2q9yzuwfXQ8syA\">点此收听更多音频版早报</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"88\" data-backw=\"546\" data-fail=\"0\" data-ratio=\"0.1617283950617284\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPfpCvcLkJrQ1DA9RIMCBmqm1XNpy9V4vNaXxl7jEgItDTnRSiaRQhJwQ/640?wx_fmt=png\" data-type=\"png\" data-w=\"810\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPfpCvcLkJrQ1DA9RIMCBmqm1XNpy9V4vNaXxl7jEgItDTnRSiaRQhJwQ/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></p>\n\n<p>&nbsp;</p>\n\n<p><strong>【商务部、科技部调整发布《中国禁止出口限制出口技术目录》】</strong>8月28日，商务部、科技部调整发布《中国禁止出口限制出口技术目录》（商务部 科技部公告2020年第38号，以下简称《目录》）。本次《目录》调整先后征求了相关部门、行业协会、业界学界和社会公众意见，共涉及53项技术条目：一是删除了4项禁止出口的技术条目；二是删除5项限制出口的技术条目；三是新增23项限制出口的技术条目；四是对21项技术条目的控制要点和技术参数进行了修改。（新华社）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【深圳中院发布实施意见为创业板改革并试点注册制全面提供司法保障】</strong>为充分发挥司法职能，全面服务保障创业板改革并试点注册制顺利运行，作为试点集中管辖涉创业板案件的法院，深圳中院8月28日发布了《关于服务保障创业板改革并试点注册制的实施意见》。（新浪财经）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【今年以来电竞相关企业新增4306家】</strong>据广州市社会科学院近日发布的调研报告，预计到2020年末，中国内地电竞用户将达到5.2亿，市场营收将达到1400亿元左右。企查查数据显示，目前我国共有电竞相关企业1.8万家，2019年新注册5400余家，同比上升44%。今年以来，全国新注册电竞相关企业已达4306家，是去年同期的1.6倍。（新京报）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【我国今年社区团购和生鲜电商领域融资金额达百亿元】</strong>2020年初新冠疫情爆发后，线上买菜的频次急速上升，整个社区团购行业迎来春天。天眼查专业版数据显示，据不完全统计，目前我国大陆地区有近200家涉及社区团购、社区生鲜相关业务的企业。据天眼查专业版数据不完全统计，今年我国社区团购和生鲜电商领域已累计发生十余次融资，金额达百亿元。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"677px\" crossorigin=\"anonymous\" data-fail=\"0\" data-ratio=\"0.1617283950617284\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w4ED4icqUVHKElQPhsUczA8AafCTjpT8PH70jDg5kYfjxBiapptvnHwd65O0zICYoFEPSiaibPbuCAqfw/640?wx_fmt=png\" data-type=\"png\" data-w=\"810\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w4ED4icqUVHKElQPhsUczA8AafCTjpT8PH70jDg5kYfjxBiapptvnHwd65O0zICYoFEPSiaibPbuCAqfw/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p><strong>【百胜中国将在香港IPO中发售4190万股普通股】</strong>据美国证券交易委员会文件：百胜中国将在香港IPO中发售4190万股普通股，其中国际发售4020万股，香港发售170万股。香港IPO最高定价为468港元/股。发行代码为9987。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"677px\" crossorigin=\"anonymous\" data-fail=\"0\" data-ratio=\"0.16049382716049382\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_jpg/03KNO9Fib2w52IicVviarknwyqvQkOz6xWYxkiam1du8kuC9ToDplRPRrJ2wNjkxvC6eHuiaQw2XFRudnaQIXFpYJnQ/640?wx_fmt=jpeg\" data-type=\"jpeg\" data-w=\"810\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/03KNO9Fib2w52IicVviarknwyqvQkOz6xWYxkiam1du8kuC9ToDplRPRrJ2wNjkxvC6eHuiaQw2XFRudnaQIXFpYJnQ/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p><strong>【完美世界：上半年净利润12.71亿元，同比增长24.53%】</strong>完美世界公告，上半年公司实现营业收入51.44亿元，同比增长40.68%，归属于上市公司股东的净利润12.71亿元，同比增长24.53%。基本每股收益0.66元。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【比亚迪：上半年净利润16.62亿元，同比增长14.29%】</strong>比亚迪8月28日晚间发布2020年半年报，公司上半年实现营业收入605.03亿元，同比下降2.7%；实现归属于上市公司股东的净利润16.62亿元，同比增长14.29%；基本每股收益0.56元。（界面）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【中兴通讯上半年营收471.99亿元，同比增长5.8%】</strong>中兴通讯发布半年度财报。报告显示，今年上半年中兴通讯营收为471.99亿元，同比增长5.8%；净利润为18.57亿元，同比增长26.29%。基本每股收益为 0.40 元人民币。（新浪财经）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【同程艺龙发布2020年第二季度财报，经调净利润1.96亿】</strong>同程艺龙发布了2020年第二季度及上半年财务报告。财报显示，2020年第二季度同程艺龙实现营收12亿元；经调整EBITDA（税息折旧及摊销前利润）为2.67亿元，经调整EBITDA利润率为22.3%；经调整净利润为1.96亿元，经调整净利润率为16.3%。（新浪科技）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【途牛第二季度营收3400万元 同比下滑93.5%】</strong>8月28日，途牛旅游网发布了截至6月30日的2020年第二季度财报，净营收为3400万元人民币（约合480万美元），同比下滑93.5% 。净亏损为1.546亿元人民币（约合2190万美元），而上年同期净亏损1.672亿元人民币。不按美国通用会计准则，净亏损1.353亿元人民币（约合1910万美元）。（证券时报）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【三六零：2020年上半年营收49.72亿元，同比下降16.08%】</strong>三六零发布2020年半年度报告。报告显示，2020年上半年三六零实现营业收入49.72亿元，同比下降16.08%；归属于上市公司股东的净利润11.19亿元，同比下降72.39%；归属于上市公司股东扣除非经常损益后的净利润9.25亿元，同比下降42.55%；基本每股收益0.17元。（新浪财经）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【永辉超市：上半年净利润18.54亿元 同比增长35.36%】</strong>8月28日消息，永辉超市对外发布2020年半年度报告，数据显示，上半年永辉超市实现营业收入505.2亿元，同比增长22.68%；实现归属于母公司股东的净利润18.54亿元，同比增长35.36%。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"677px\" crossorigin=\"anonymous\" data-fail=\"0\" data-ratio=\"0.16049382716049382\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPCQctgBVFdfxhk5u1SXIbY761EqfZ9LD7hKiaAiakaVu7FDQCmloIPUqg/640?wx_fmt=png\" data-type=\"png\" data-w=\"810\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPCQctgBVFdfxhk5u1SXIbY761EqfZ9LD7hKiaAiakaVu7FDQCmloIPUqg/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p><strong>【联发科：已向美方申请，力求9月15日后仍可向华为继续供货】</strong>据报道，芯片生产商联发科技（又简称联发科）对外证实，目前该公司已依照规定向美方申请中，力求9月15日后仍可向华为继续供货。（新浪科技）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【华为上半年日赚2.4亿，打压下净利润同比增长23%】</strong>28日，华为投资控股有限公司在银行间市场发布上半年财报。2020年上半年，华为共实现营业收入4507亿元，同比增长13.67%；净利润431亿元，同比增长23.49%。分业务来看，已占据华为半壁江山的消费者业务依然增长强劲，尽管美国的打压直接影响其消费者业务在海外市场份额。上半年华为消费者业务增长最快。其中，消费者业务收入为2558亿元，相比于去年同期2208亿元，大幅增长15.85%。（e公司）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【暴风集团：9月21日起股票交易进入退市整理期】</strong>暴风集团8月28日晚间公告，公司8月28日收到深交所《关于暴风集团股份有限公司股票终止上市的决定》，自深圳证券交易所作出公司股票终止上市的决定后十五个交易日届满的次一交易日起（2020年9月21日）起，公司股票交易进入退市整理期。（证券时报）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【顺丰总裁王卫发出5亿红包，全部员工每人888】</strong>8月28日，多位顺丰小哥爆料，在8月28日早上8点28分意外收到顺丰总裁王卫发来的888元慰问金，并且&ldquo;是面向全体员工发出的，客服的妹子也收到了&rdquo;。根据记者测算，以顺丰现在的人员规模，王卫这次自掏腰包的总金额要接近5亿元。（快递杂志）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【腾讯科技（深圳）有限公司申请自动驾驶、车辆碰撞预警等专利】</strong>天眼查App显示，近日，腾讯科技（深圳）有限公司新增多项专利。包括&ldquo;自动驾驶方法、装置、设备、系统、车辆和计算机可读存储介质&rdquo;、&ldquo;车辆碰撞的预警方法及装置&rdquo;、&ldquo;车辆驾驶风险应对方法、装置&rdquo;、&ldquo;车辆通信方法、装置、计算机可读介质及电子设备&rdquo;等。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【蔚来拟发售7500万股ADS，8月31日开始交易】</strong>发行通过摩根士丹利、中金公司和美国银行进行。发行收益将用于扩大股本及公司在蔚来中国的所有权，回购蔚来中国某些少数股东所持有的股权，以及用于自动驾驶技术研发、全球市场开发和一般公司运营目的。预计交易日期为8月31日。（彭博）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【ofo小黄车关联公司法定代表人戴威再被限制消费】</strong>天眼查App显示，近日，ofo小黄车关联公司北京拜克洛克科技有限公司的法定代表人戴威收到限制消费令。该限制消费令由长沙市雨花区人民法院下发，立案执行申请人为罗欢。在该限制消费令中，戴威不得在星级以上宾馆、酒店、夜总会、高尔夫球场等场所进行高消费，购买不动产或者新建、扩建、高档装修房屋等。值得注意的是，目前，戴威已有多份限制消费令。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【元气森林在厦门成立全资子公司 注册资本500万】</strong>天眼查显示，8月26日，元气森林（厦门）食品有限公司成立，法定代表人为谢丹阳，注册资本500万元。公司经营范围包含食品经营、食品互联网销售、酒类经营等，由元气森林（北京）食品科技集团有限公司100%控股。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【软银计划出售电信子公司价值138亿美元股份】</strong>软银集团周五表示，计划出售其电信子公司SoftBank Corp的1.02万亿股股票，包括超额配售在内。这将使其持股从现在的62.1%减至40.4%，按周五收盘价计算，此次出售的股份价值1.47万亿日元（约合138亿美元）。软银表示，此次出售将于9月14日至16日进行。（新浪财经）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【特斯拉上海工厂计划招募近千名员工，为生产Model Y做准备】</strong>电动汽车制造商特斯拉正准备在其上海工厂试生产跨界SUV Model Y，为此宣布招聘近900个制造业工作岗位工人。目前，特斯拉正在为Model Y跨界车在中国市场的首次投产做准备，预计将于2021年初正式投产。在此之前，该公司必须雇佣一支规模可观的团队，以帮助处理车辆的大规模生产。（腾讯科技）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【可口可乐宣布重组业务的战略步骤】</strong>可口可乐宣布重组其业务的战略步骤，并为员工提供了自愿离职一揽子计划的选择。可口可乐表示，结构性变化&ldquo;将导致一些人员和资源的重新分配，其中包括自愿和非自愿裁减雇员&rdquo;，但未提供具体细节。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"88\" data-backw=\"546\" data-fail=\"0\" data-ratio=\"0.1617283950617284\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPt4Z28NyHR2NkawLYHalTibCeuunmSILY5gbMurWRrA4kI50qrPHCpfg/640?wx_fmt=png\" data-type=\"png\" data-w=\"810\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPt4Z28NyHR2NkawLYHalTibCeuunmSILY5gbMurWRrA4kI50qrPHCpfg/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p><strong>【三星Galaxy Note20系列等多款产品在国内正式发售】</strong>三星Galaxy Note20系列、三星Galaxy Tab S7|S7+、三星Galaxy Watch3 LTE版，以及三星Galaxy Buds Live在国内正式发售。Galaxy Note20系列采用了骁龙865 Plus旗舰处理器、双模5G和Wi-Fi 6网络、支持刷新率智能调整的屏幕、以及后置三摄组合。此外，Galaxy Note20系列产品拥有冰薄荷、冷山灰、曜岩黑、初露白四款配色，还引入了新配色迷雾金。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【微信内测&ldquo;群直播&rdquo;入口】</strong>8月28日，据公众号&ldquo;微果酱&rdquo;消息，不少微信用户发现，在群聊场景中点击聊天对话框&ldquo;+&rdquo;，下方菜单栏出现&ldquo;群直播&rdquo;入口。目前该功能正在灰度内测中。截图显示，&ldquo;群直播&rdquo;支持和群内其他成员实时视频。直播发起后，会自动在群中发出直播链接，并在群聊顶部显示&ldquo;群里共X场直播&rdquo;。</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"593\" data-backw=\"546\" data-fail=\"0\" data-ratio=\"1.086111111111111\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_jpg/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1X3YDBxIsGwicaicQJNy1wN0sRiawFic241tS71f97F458bcbAG02tCIFZQ/640?wx_fmt=jpeg\" data-type=\"jpeg\" data-w=\"1080\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1X3YDBxIsGwicaicQJNy1wN0sRiawFic241tS71f97F458bcbAG02tCIFZQ/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>图源：&ldquo;微果酱&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【小米发布第三代屏下相机技术，明年正式量产】</strong>28日讯，小米正式发布第三代屏下相机技术，并宣布明年将正式量产搭载第三代屏下摄像头的智能手机。第三代屏下相机技术方案可以在不影响整块屏幕显示效果的情况下，将前置摄像头隐藏在屏幕之下，没有挖孔、水滴的视觉阻碍，做到真正的全面屏形态。（《科创板日报》）</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"742\" data-backw=\"546\" data-fail=\"0\" data-ratio=\"1.3603896103896105\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1dploWhzuEkWXsswgpORozfQ8eA9miczcoZlDXWIWDdWrtialhJfbjSpQ/640?wx_fmt=png\" data-type=\"png\" data-w=\"616\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1dploWhzuEkWXsswgpORozfQ8eA9miczcoZlDXWIWDdWrtialhJfbjSpQ/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【中兴手机：全球首款商用屏下摄像手机将于9月1日正式发布</strong><strong>】</strong>8月28日消息，中兴手机宣布其全球首款商用屏下摄像手机AXON 20 5G将于9月1日正式发布，并且9月即可量产发货。</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"256\" data-backw=\"546\" data-fail=\"0\" data-ratio=\"0.4686746987951807\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ15fegfEjbM5qWRpgS837Xg9MFujQNfXzPNz2HvHs1AzRoemRwqHRvicg/640?wx_fmt=png\" data-type=\"png\" data-w=\"830\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ15fegfEjbM5qWRpgS837Xg9MFujQNfXzPNz2HvHs1AzRoemRwqHRvicg/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【OPPO拉伸屏设计专利曝光：手机显示面积可增加80%】</strong>据LetsGoDigital报道，OPPO申请了一项关于可伸缩手机屏幕的专利，在伸展屏幕后，手机屏幕的显示面积可增加80%。报道称，OPPO于2020年2月27日向国家知识产权局提交该专利，并于8月28日向外界公布。专利申请文档中包含了28张草图和简要说明，主要展示可伸缩手机的屏幕设计。</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"677px\" crossorigin=\"anonymous\" data-fail=\"0\" data-ratio=\"0.5346666666666666\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1w9Jf6X62zQAYXPWibZNfFVjlh5vaB0SZibvKlMCW6VqemYfzocGOQmgw/640?wx_fmt=png\" data-type=\"png\" data-w=\"750\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1w9Jf6X62zQAYXPWibZNfFVjlh5vaB0SZibvKlMCW6VqemYfzocGOQmgw/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【微信读书新版本上线，支持app内购买纸质书】</strong>8月28日消息，微信读书5.0.0版本上线，新增支持app内购买纸质书，有声书AI语音转文稿优化，在书籍详情页发现作者其他作品等功能。</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"937\" data-backw=\"546\" data-fail=\"0\" data-ratio=\"1.7155172413793103\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_jpg/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1CgibOoK2rBV3AKHIUSicEAt1KmvzpZzncrXpYnic8iak2F8mqwBPsUzTfQ/640?wx_fmt=jpeg\" data-type=\"jpeg\" data-w=\"580\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/03KNO9Fib2w6L8b3gMCqcVibdauYW7QIZ1CgibOoK2rBV3AKHIUSicEAt1KmvzpZzncrXpYnic8iak2F8mqwBPsUzTfQ/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>【新iPad Air说明书曝光：全面屏设计 电源键集成Touch ID】</strong>一组据称是新iPad Air 的说明书在网上流传开来，从曝光的说明书看，新iPad Air将采用全面屏设计，配备USB-C接口，最大的看点是Touch ID集成在了电源键中。（新浪财经）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"100%\" crossorigin=\"anonymous\" data-backh=\"88\" data-backw=\"546\" data-fail=\"0\" data-ratio=\"0.1617283950617284\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPaZKghYR4uU6utcyjoR3jEb57So9KI43wcI43nBXibACQamAmbG2Aibpw/640?wx_fmt=png\" data-type=\"png\" data-w=\"810\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w42HtmqnSxpYdP5Q6tgIyQPaZKghYR4uU6utcyjoR3jEb57So9KI43wcI43nBXibACQamAmbG2Aibpw/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></section>\n\n<p>&nbsp;</p>\n\n<p><strong>【俞敏洪称从未编造一份假数据，觉得瑞幸挺丢脸的】</strong>8月28日晚，俞敏洪在亚布力论坛夏季高峰会上表示，坚持正确道路是企业立足的根本，投机的或者编造数据的企业在大考中过不了关，瑞幸咖啡就是一个典型的例子，挺丢中国人的脸。俞敏洪称，新东方在自己的历史上从未编造过一份假数据。（老板联播）</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>昨日早报回顾 &rArr;&nbsp;</strong><a data-itemshowtype=\"0\" data-linktype=\"2\" hasload=\"1\" href=\"http://mp.weixin.qq.com/s?__biz=MjM5OTAzMjc4MA==&amp;mid=2650135201&amp;idx=1&amp;sn=4ac57d2796237ccb51fb65007daf2e84&amp;chksm=bec0d80289b751140e62587c72d1263d93d31793fc8f33d1ba163d5d4633c1acd6208deb5841&amp;scene=21#wechat_redirect\" tab=\"innerlink\" target=\"_blank\" textvalue=\"TikTok全球CEO离职内幕曝光；阿里推出阿里云网盘对标百度云盘；滴滴近4成性骚扰为男乘客骚扰男司机 | 邦早报\"><strong>TikTok全球CEO离职内幕曝光；阿里推出阿里云网盘对标百度云盘；滴滴近4成性骚扰为男乘客骚扰男司机 | 邦早报</strong></a></p>\n\n<p>&nbsp;</p>\n\n<p><img _width=\"645px\" crossorigin=\"anonymous\" data-backh=\"14\" data-backw=\"545\" data-copyright=\"0\" data-fail=\"0\" data-ratio=\"0.025777777777777778\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w5h13fekc4jg8KbBEkxB14UVRuSWxDuKd65LNMHYDJAiaiaJHF1QovUiczL57Y8jD5ibSBTDfvoia7UlQg/640?wx_fmt=png\" data-type=\"png\" data-w=\"1125\" src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w5h13fekc4jg8KbBEkxB14UVRuSWxDuKd65LNMHYDJAiaiaJHF1QovUiczL57Y8jD5ibSBTDfvoia7UlQg/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1\" /></p>\n\n<p>&nbsp;</p>\n\n<section><img _width=\"677px\" crossorigin=\"anonymous\" data-fail=\"0\" data-ratio=\"0.5217391304347826\" data-s=\"300,640\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/03KNO9Fib2w4RF6iaS2z3wYlTek0TvaqkRkGZRc5u64HibdgThehreIW1YHSzg3iaF5kppqNlNEgcFibX4iaje1fzhBg/640?wx_fmt=png\" data-type=\"png\" data-w=\"690\"